import React, { useState } from "react";
import { Menu, Segment } from "semantic-ui-react";
import ModalDim from "./ModalDim";

export default function Navbarr() {
  const [activeItem, setActiveItem] = useState("home");

  return (
    <div>
      <Segment inverted>
        <Menu pointing inverted secondary stackable size="large">
          <Menu.Item>
            <img src="https://react.semantic-ui.com/logo.png" />
          </Menu.Item>
          <Menu.Item
            name="home"
            active={activeItem === "home"}
            onClick={(e) => console.log(e.target.name)}
          />
          <Menu.Item
            name="den"
            active={activeItem === "den"}
            onClick={(e) => console.log(e.target.name)}
          />
          <Menu.Menu position="right">
            <Menu.Item>
              <ModalDim title="Sign In" value="signin" />
            </Menu.Item>
            <Menu.Item>
              <ModalDim title="Sign Up" value="signup" />
            </Menu.Item>
          </Menu.Menu>
        </Menu>
      </Segment>
    </div>
  );
}
